{\rtf1\ansi\ansicpg1252\deff0\deflang1033{\fonttbl{\f0\fnil\fcharset0 Calibri;}}
{\*\generator Msftedit 5.41.21.2510;}\viewkind4\uc1\pard\sa200\sl276\slmult1\lang9\f0\fs22 Cet onglet vous permet d'afficher les références dans le projet en cours. Cliquez sur le menu \b Vue \b0 pour modifier les options d'affichage. \par
Double-cliquez sur une référence pour l'insérer.\par Pour insérer plusieurs citations, insérez la première citation puis placez le curseur sur la citation et double-cliquez sur la seconde référence pour l'insérer.\par
}

